import Layout from "../components/layout/layout";

function Register() {
  const position = {
    container: "w-3/5 md:5/12 lg:5/12 m-auto py-10",
    heading: "mb-10",
  };
  const design = {
    heading: "text-3xl text-gray-700",
  };

  return (
    <Layout>
      <div className={position.container}>
        <h1 className={`${position.heading} ${design.heading}`}>Eternal</h1>
      </div>
    </Layout>
  );
}

export default Register;
